y was it to add a product attribute?'=>'Насколько легко было добавить атрибут товаров?','How easy was it to add a product tag?'=>'Насколько легко было добавить метку товара?','How easy was it to add a product?'=>'Насколько просто было добавить товар?','How easy was it to add product category?'=>'Насколько легко было добавить категорию товаров?','How easy was it to edit your product?'=>'Насколько просто было редактировать товар?','How easy was it to import products?'=>'Насколько просто было импортировать товар?','How easy was it to update an order?'=>'Насколько легко было обновить заказ?','How easy was it to update your settings?'=>'Насколько легко было обновить настройки?','How easy was it to use search?'=>'Насколько легко было использовать поиск?','How many notes in the database?'=>'Сколько заметок в базе данных?','How many products should be shown per row?'=>'Сколько товаров должно быть показано в строке?','How many rows of products should be shown per page?'=>'Сколько строк товаров должно быть показано на странице?','How many times the coupon can be used in total.'=>'Общее количество возможных использований купона.','How many times the coupon can be used per customer.'=>'Сколько раз данный купон может быть использован одним пользователем.','How many times this coupon can be used before it is void.'=>'Сколько раз данный купон может быть использован, прежде чем он будет аннулирован.','How many times this coupon can be used by an individual user. Uses billing email for guests, and user ID for logged in users.'=>'Сколько раз данный купон может быть использован отдельным пользователем. Отслеживается по ID пользователя для зарегистрированных покупателей и по Email\'у для незарегистрированных.','How should products be sorted in the catalog by default?'=>'Как товары должны быть отсортированы в каталоге по умолчанию?','How terms in this attribute are sorted by default.'=>'Как элементы этого атрибута сортируются по умолчанию.','How the quantity of this item should be controlled, for example, any limits in place.'=>'Как следует контролировать количество этого товара, например, какие ограничения существуют.','How the sender email appears in outgoing WooCommerce emails.'=>'Какой Email указан в исходящих электронных сообщениях WooCommerce.','How the sender name appears in outgoing WooCommerce emails.'=>'Какое имя указывать в исходящих электронных сообщениях WooCommerce.','How to calculate delivery charges'=>'Каким образом подсчитывать стоимость доставки','How to customize your product catalog'=>'Как настроить каталог товаров','How to Migrate from Magento to WooCommerce'=>'Как перейти с Magento на WooCommerce','How to update your database table prefix'=>'Как обновить префикс таблицы базы данных','How to update your PHP version'=>'Как обновить версию PHP','Howland Island'=>'Остров Хауланд','HTML'=>'HTML','HTML description of the resource.'=>'HTML описание ресурса.','HTML email template'=>'Шаблон HTML Email','HTML template'=>'Шаблон HTML','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'Электронные письма HTML/Multipart используют DOMDocument для генерации вложенных в шаблоны стилей CSS.','http://'=>'http://','https://woocommerce.com'=>'https://woocommerce.com','https://woocommerce.com/'=>'https://woocommerce.com/','https://wordpress.org/support/article/custom-fields/'=>'https://wordpress.org/support/article/custom-fields/','Huambo'=>'Уамбо','Huancavelica'=>'Уанкавелика','Hubei / 湖北'=>'Хубэй','Huehuetenango'=>'Уэуэтенанго','Huelva'=>'Уэльва','Huesca'=>'Уэска','Huila'=>'Хуила','Human readable label for the stat.'=>'Понятное имя параметра.','Human readable segment label, either product or variation name.'=>'Удобочитаемая метка сегмента, название товара или вариации.','Hunan / 湖南'=>'Хунань','Hunedoara'=>'Хунедоара','Hungarian forint'=>'Венгерский форинт','Hungary'=>'Венгрия','Huánuco'=>'Уануко','Huíla'=>'Уила','Hyogo'=>'Хёго','Hîncești'=>'Хынчешты','I don\'t know how to get a date from a %s'=>'Я не знаю, как получить дату из %s','I have read and agree to the website %s'=>'Я прочитал(а) и принимаю %s сайта','I plan to sell both physical and digital products'=>'Я планирую продавать как физические, так и цифровые товары','I plan to sell digital products'=>'Планирую продавать цифровые товары','I plan to sell physical products'=>'Планирую продавать физические товары','I will also be selling products or services in person.'=>'Я буду также продавать товары или услуги лично.','Ialomița'=>'Яломица','Ialoveni'=>'Яловены','Iași'=>'Яссы','IBAN'=>'IBAN','Ibanda'=>'Ибанда','Ibaraki'=>'Ибараки','Ica'=>'Ика','Iceland'=>'Исландия','Icelandic kr&oacute;na'=>'Исландская крона','ID'=>'ID','ID %d'=>'ID %d','ID is invalid.'=>'ID неверный.','ID of parent grouping.'=>'Идентификатор родительской группы.','ID of the note record.'=>'Идентификатор записи заметки.','ID of the parent product, if applicable.'=>'Идентификатор родительского товара, если есть.','ID of the shipping method that provided the rate.'=>'Идентификатор способа доставки, на основе которого был рассчитан тариф.','ID of the shipping rate.'=>'Идентификатор тарифа на доставку.','ID to reassign posts to.'=>'ID, на который передается сообщение.','ID.'=>'ID.','ID: %d'=>'ID: %d','Idaho'=>'Айдахо','IDs for settings sub groups.'=>'Идентификаторы подгрупп настроек.','If checked, free shipping would be available based on pre-discount order amount.'=>'Если галочка установлена, может быть доступна бесплатная доставка при определенной сумме заказа без учета скидки.','If COD is only available for certain methods, set it up here. Leave blank to enable for all methods.'=>'Если оплата наложенным платежом доступна только для определенных способов доставки, задайте их здесь. Оставьте поле пустым, чтобы включить для всех методов.','If enabled, this text will be shown site-wide. You can use it to show events or promotions to visitors!'=>'Если включено, этот текст будет отображаться на всем сайте. Его можно использовать, чтобы информировать посетителей о мероприятиях или специальных предложениях!','If managing stock, this controls if backorders are allowed.'=>'Если включено управление запасами, эта опция разрешает приём предзаказов.','If managing stock, this controls whether or not backorders are allowed. If enabled, stock quantity can go below 0.'=>'При управлении наличием этот параметр определяет, разрешены ли предзаказы. Если этот параметр включен, счётчик складских запасов может принимать значения меньше 0.','If requested, calculates attribute term counts for products in the collection.'=>'По запросу вычисляет количество значений атрибутов товаров в коллекции.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Если выбрана принудительная загрузка или «X-Accel-Redirect/X-Sendfile», но она не работает, система будет использовать метод переадресации в крайнем случае. Смотрите <a href="%1$s">это руководство</a> для получения более подробной информации.','If the payment was refunded via the API.'=>'Если уплаченные средства были возмещены через API.','If the product is downloadable.'=>'Если товар скачиваемый.','If the product is virtual.'=>'Если товар виртуальный.','If the quantity in the cart is editable or fixed.'=>'Количество в корзине редактируемое или фиксированное.','If the variation is downloadable.'=>'Если вариация скачиваемая.','If the variation is virtual.'=>'Если вариация виртуальная.','If the variation is visible.'=>'Если вариация видимая.','If this attribute has term archive pages.'=>'Если у этого атрибута есть архивные страницы значений.','If this is a default attribute'=>'Если это атрибут по умолчанию','If true and if the free shipping method requires a coupon, this coupon will enable free shipping.'=>'Если этот параметр имеет значение TRUE и для бесплатной доставки требуется купон, этот купон даст покупателю право на бесплатную доставку.','If true, calculates rating counts for products in the collection.'=>'Подсчитывает оценки товаров в коллекции.','If true, calculates stock counts for products in the collection.'=>'При значении true, рассчитывает запасы товаров в коллекции.','If true, calculates the minimum and maximum product prices for the collection.'=>'Если установлено значение ИСТИНА, возвращает минимальные и максимальные цены товаров в коллекции.','If true, empty terms will not be returned.'=>'Если установлено значение true, пустые условия не будут возвращаться.','If true, only one item of this product is allowed for purchase in a single order.'=>'Если верно, то одним заказом можно приобрести лишь одну единицу данного товара.','If true, the coupon can only be used individually. Other applied coupons will be removed from the cart.'=>'Применение купона только отдельно от других. Остальные купоны будут удалены из корзины.','If true, the note will be shown to customers and they will be notified. If false, the note will be for admin reference only.'=>'Если этот параметр имеет значение TRUE, заметка будет показана клиентам и им будет отправлено уведомление. Если этот параметр имеет значение FALSE, заметка будет отображаться только для администратора.','If true, this coupon will not be applied to items that have sale prices.'=>'Если опция включена, данный купон не будет применяться к товарам со скидками.','If true, this note will be attributed to the current user. If false, the note will be attributed to the system.'=>'Если это правда, данное примечание будет приписано текущему пользователю. Если это ложь, примечание будет приписано системе.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Если вы хотите оформить WooCommerce родительской темой, которую создал кто-то другой, мы рекомендуем воспользоваться дочерней темой. См. <a href="%s" target="_blank">"Как создать дочернюю тему"</a>','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'Если используется метод загрузки X-Accel-Redirect вместе с NGINX, настройки должны соответствовать рекомендациям этого <a href=\'%s\' target="_blank" title="Digital/Downloadable Product Handling">руководства</a>.','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'Если вы скопировали файл-шаблон, чтобы что-то изменить, вам будет нужно скопировать новую версию шаблона и снова применить изменения.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Когда вы создаёте аккаунт, мы сохраняем ваше имя, адрес, Email и телефон для автоматического заполнения формы при оформлении заказов в будущем.','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Если на сайте определена страница "Условий", то клиент должен будет принять их перед оплатой заказа.','If you didn\'t make this request, just ignore this email. If you\'d like to proceed:'=>'Если вы не отправляли этот запрос, просто проигнорируйте это сообщение. Если хотите продолжить:','If you don\'t have an application password (not your account password), generate a password from %s'=>'Если у вас нет пароля для приложения (это не пароль для вашей учётной записи), создайте его в %s','If you find a bug within WooCommerce core you can create a ticket via <a href="%1$s">GitHub issues</a>. Ensure you read the <a href="%2$s">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="%3$s">system status report</a>.'=>'При обнаружении неполадок в ядре WooCommerce можно оформить заявку через <a href="%1$s">GitHub Issues</a>. Обязательно прочитайте <a href="%2$s">руководство контрибутора</a>, прежде чем отправлять отчет. Чтобы мы могли быстрее решить проблему, опишите ее как можно подробнее и приложите <a href="%3$s">отчёт о состоянии системы</a>.','If you have a coupon code, please apply it below.'=>'Если у вас есть промокод, укажите его ниже.','If you have shopped with us before, please enter your details below. If you are a new customer, please proceed to the Billing section.'=>'Если вы уже оформляли заказ на нашем сайте, пожалуйста, введите свои данные ниже. Если вы являетесь новым клиентом, пожалуйста, заполните платёжные данные в соответствующем разделе.','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Если вам нравится %1$s, поставьте нам оценку %2$s. Заранее спасибо!','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'При необходимости здесь можно настроить структуру URL-адресов ваших товаров. Например, если использовать <code>shop</code> (магазин), то ваши ссылки на товары будут выглядеть так: <code>%sshop/sample-product/</code>. Такая настройка относится только к URL-адресам товаров. Она не влияет на другие данные, например на категории товаров.','If you need to access the setup wizard again, please click on the button below.'=>'Если вы хотите снова получить доступ к помощнику установки, кликните по кнопке ниже.','If you need to enable or disable the extended task lists, please click on the button below.'=>'Если вам нужно снова включить или выключить расширенные списки задач, нажмите кнопку ниже.','If you need to enable or disable the task lists, please click on the button below.'=>'Если вам нужно включить или отключить список задач, нажмите на кнопку ниже.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Если вы хотите предложить <span class="help_tip" data-tip="%1$s">текущие тарифы</span> от конкретной транспортной компании (например, UPS), доступные расширения для WooCommerce см. <a href="%2$s" target="_blank">здесь</a>.','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Если ваш основной email PayPal отличается от введенного выше, то введите ваш основной получатель email здесь. Используется для подтверждения запросов IPN.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Если ваш магазин находится на территории ЕС, рекомендуем помимо автоматических налогов использовать расширение "Номер плательщика НДС (ЕС)". Благодаря нему на странице оформления заказа появляется поле, которое позволяет собирать и проверять номер плательщика НДС в ЕС, если такой есть у клиента.','IFSC'=>'IFSC код','Ifugao'=>'Ифугао','Iganga'=>'Иганга','Ilaam (ایلام)'=>'Илам (ایلام)','Ilfov'=>'Илфов','Illinois'=>'Иллинойс','Illizi'=>'Иллизи','Ilocos Norte'=>'Северный Илокос','Ilocos Sur'=>'Южный Илокос','Iloilo'=>'Илоило','Image'=>'Картинка','Image alternative text.'=>'Альтернативный текст изображения.','Image data.'=>'Данные изображения.','Image ID.'=>'ID изображения.','Image name.'=>'Название изображения.','Image of the product that the review belongs to.'=>'Изображение товара, к которому относится отзыв.','Image position. 0 means that the image is featured.'=>'Положение изображения. 0 означает, что используется рекомендуемое изображение.','Image size used for products in the catalog.'=>'Размер изображения для товаров