ted'=>'Клиент не может быть удалён','The database update process runs in the background and may take a little while, so please be patient. Advanced users can alternatively update via %1$sWP CLI%2$s.'=>'Процесс обновления базы данных в фоновом режиме может занять некоторое время, пожалуйста, подождите. Продвинутые пользователи могут обновить базу, используя %1$sWP CLI%2$s.','The database version for WooCommerce. This should be the same as your WooCommerce version.'=>'Версия базы данных WooCommerce. Она должна совпадать с версией базы данных WooCommerce.','The date of the customer last order, as GMT.'=>'Дата последнего заказа этого клиента (в формате GMT).','The date of the download, as GMT.'=>'Дата загрузки (в формате GMT).','The date of the download, in the site\'s timezone.'=>'Дата загрузки (в часовом поясе сайта).','The date the coupon expires, as GMT.'=>'Дата окончания срока действия купона (в формате GMT).','The date the coupon expires, in the site\'s timezone.'=>'Дата окончания срока действия купона (в часовом поясе сайта).','The date the coupon was created, as GMT.'=>'Дата создания купона (в формате GMT).','The date the coupon was created, in the site\'s timezone.'=>'Дата создания купона в часовом поясе сайта.','The date the coupon was last modified, as GMT.'=>'Дата последнего изменения купона (в формате GMT).','The date the coupon was last modified, in the site\'s timezone.'=>'Дата последнего изменения купона в часовом поясе сайта.','The date the customer was created, as GMT.'=>'Дата создания клиента (в формате GMT).','The date the customer was created, in the site\'s timezone.'=>'Дата создания пользователя в часовом поясе сайта.','The date the customer was last modified, as GMT.'=>'Дата последнего изменения профиля этого клиента (в формате GMT).','The date the customer was last modified, in the site\'s timezone.'=>'Дата последнего изменения пользователя в часовом поясе сайта.','The date the image was created, as GMT.'=>'Дата создания изображения (в формате G