.'=>'Дата, когда доступ к загрузке будет закрыт, в часовом поясе сайта.','The date you provided is invalid.'=>'Предоставленная дата неверна.','The date/time the action is/was scheduled to run.'=>'Дата/время, когда было запланировано выполнение этого действия.','The decimal separator of displayed prices.'=>'Десятичный разделитель цен.','The default timezone for your server.'=>'Временная зона по умолчанию для вашего сервера.','The delivery duration, in seconds.'=>'Длительность доставки в секундах.','The discount type for the coupon (e.g. percentage or fixed amount)'=>'Тип скидки по купону (в процентах или фиксированная величина)','The downloadable file %1$s cannot be used as it does not have an allowed file type. Allowed types include: %2$s'=>'Скачиваемый файл %1$s не может быть использован, так как его формат не входит в список допустимых. Допустимые форматы файлов: %2$s','The downloadable file %1$s cannot be used: it is not located in an approved directory. Please contact a site administrator for help. %2$sLearn more.%3$s'=>'Невозможно использовать скачиваемый файл %1$s: он не находится в разрешенной директории. Обратитесь к администратору сайта. %2$sПодробнее.%3$s','The downloadable file %s cannot be used as it does not exist on the server.'=>'Скачиваемый файл %s не может быть использован, так как он отсутствует на сервере.','The downloadable file %s cannot be used as it has been disabled.'=>'Невозможно использовать скачиваемый файл %s, поскольку он деактивирован.','The email address for the customer.'=>'Email для пользователя.','The Eway extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Расширение Eway для WooCommerce позволяет принимать платежи по банковской карте прямо в магазине, без перенаправления клиентов на сторонний сайт для оплаты.','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Расширение eWAY для WooCommerce позволяет принимать платежи по банковской карте прямо в вашем магазине, без перенаправления клиентов на сторонний сайт для оплаты.','The extension %s has been deactivated successfully.'=>'Расширение %s деактивировано.','The file does not exist, please try again.'=>'Этот файл не существует, пожалуйста, попробуйте еще раз.','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Файл пуст, или использует иную кодировку, нежели UTF-8, попробуйте ещё раз.','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Следующие активные плагины пока не объявляют совместимость с версией WooCommerce %s и должны быть обновлены или проверены перед тем как вы продолжите:','The following addresses will be used on the checkout page by default.'=>'Следующие адреса будут использованы по умолчанию при оформлении заказов.','The following note has been added to your order:'=>'К вашему заказу было добавлено следующее примечание:','The following options affect how prices are displayed on the frontend.'=>'Следующие параметры влияют на то, как отображаются цены во фронтэнде.','The following plugins will be installed and activated for you:'=>'Будут установлены и активированы следующие плагины:','The following shipping methods apply to customers with shipping addresses within this zone.'=>'Следующие способы доставки доступны клиентам с адресами доставки в пределах этой зоны.','The following wizard will help you configure your store and get you started quickly.'=>'Следующий мастер поможет вам быстро настроить и запустить ваш магазин.','The group "%s" does not exist.'=>'Группы «%s» не существует.','The handler for the route is invalid'=>'Неправильный обработчик для маршрута','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Главная страница — один из самых важных разделов вашего магазина. Правильная настройка может помочь повысить конверсию и интерес посетителей. Не забудьте отредактировать домашнюю страницу, которую мы создали для вашего магазина в процессе адаптации.','The homepage URL of your site.'=>'URL главной страницы вашего сайта.','The HTTP response code from the receiving server.'=>'Код ответа HTTP от принимающего сервера.','The HTTP response message from the receiving server.'=>'Ответное сообщение HTTP от принимающего сервера.','The ID for the parent of the resource.'=>'ID родителя данного ресурса.','The ID for the resource.'=>'ID ресурса.','The id for the resource.'=>'ID для ресурса.','The ID of the package the shipping rates belong to.'=>'Идентификатор посылки, к которой относятся тарифы доставки.','The ID of the payment method being used to process the payment.'=>'Идентификатор способа оплаты, используемого для обработки платежа.','The image of the note, if any.'=>'Изображение заметки, если есть.','The indicated downloads have been disabled (invalid location or filetype&mdash;%1$slearn more%2$s).'=>'Указанные скачивания деактивированы (недопустимые расположение или тип файла — %1$sподробнее%2$s).','The installed version of the current active theme.'=>'Версия активной темы сайта.','The installed version of the parent theme.'=>'Версия родительской темы сайта.','The item ID %1$s attempted to register using an invalid option. The arguments `menuId` and `parent` are not allowed for add_setting_item()'=>'Попытка зарегистрировать идентификатор позиции %1$s с помощью неправильной опции. Аргументы menuId и parent в параметре add_setting_item() недопустимы.','The JSONP callback function is invalid'=>'Вызываемая в JSONP функция некорректна','The key that will be used when dealing with MaxMind Geolocation services. You can read how to generate one in <a href="%1$s">MaxMind Geolocation Integration documentation</a>.'=>'Ключ для использования с службами геолокации MaxMind. Вы можете прочитать как создать его в <a href="%1$s">документации по интеграции MaxMind</a>.','The largest filesize that can be contained in one post.'=>'Максимальный размер файла, который может содержаться в одной записи.','The largest filesize that can be uploaded to your WordPress installation.'=>'Наибольший размер файла, который может быть загружен на ваш сайт.','The layout of the note (e.g. banner, thumbnail, plain).'=>'Макет заметки (например, баннер, миниатюра, без форматирования).','The location that the MaxMind database should be stored. By default, the integration will automatically save the database here.'=>'Место, где следует хранить базу данных MaxMind. По умолчанию интеграция автоматически сохранит базу данных здесь.','The logical relationship between attributes when filtering across multiple at once.'=>'Логическая связь между атрибутами при одновременной фильтрации по нескольким.','The main body background color. Default %s.'=>'Цвет фона основного текста. По умолчанию %s.','The main body text color. Default %s.'=>'Цвет основного текста. По умолчанию %s.','The maximum allowed setting is %d'=>'Максимально допустимая настройка - %d ','The maximum amount of memory (RAM) that your site can use at one time.'=>'Максимальное количество памяти (RAM), которое ваш сайт может использовать единовременно.','The maximum number of individual items this coupon can apply to when using product discounts. Leave blank to apply to all qualifying items in cart.'=>'Максимальное число индивидуальных элементов на которые распространяется купон при использовании скидки. Оставьте пустым чтобы применить на все перечисленные объекты в корзине.','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Максимальное количество переменных, которое ваш сервер может использовать для одной функции чтобы предотвратить перезагрузку.','The maximum quantity allowed in the cart for this line item.'=>'Максимальное количество товара, разрешённое для единовременной покупки.','The maximum quantity that can be added to the cart is %s'=>'Максимальное количество, допустимое для единоразового добавления в корзину = %s','The maximum quantity that can be added to the cart.'=>'Максимальное количество товаров в корзине.','The maximum spend for this coupon is %s.'=>'Максимальная сумма покупок для этого промокода составляет %s.','The MaxMind license key is invalid. If you have recently created this key, you may need to wait for it to become active.'=>'Ключ рецензии MaxMind неверен. Если вы недавно его создали, то возможно вам стоит подождать пока он станет активен.','The minimum allowed setting is %d'=>'Минимально допустимая настройка - %d','The minimum quantity allowed in the cart for this line item.'=>'Минимальное количество товара, разрешённое для единовременной покупки.','The minimum quantity that can be added to the cart is %s'=>'Минимальное количество добавляемых в корзину товаров: %s','The minimum quantity that can be added to the cart.'=>'Минимальное количество товаров в корзине.','The minimum spend for this coupon is %s.'=>'Для этого промокода установлена минимальная сумма заказа %s.','The name of the current active theme.'=>'Название активной темы сайта.','The name of the parent theme.'=>'Название родительской темы.','The name of the tax.'=>'Название налога.','The next queue will begin processing in approximately %d seconds.'=>'Обработка следующей очереди начнется примерно через %d сек.','The number of decimal points shown in displayed prices.'=>'Количество знаков после запятой, отображаемых в ценах.','The object cannot be deleted.'=>'Объект не может быть удалён.','The object does not support trashing. Set \'%s\' to delete.'=>'Объект не поддерживает удаление в мусорку. Установите «%s» для удаления.','The object has already been trashed.'=>'Объект уже удалён в мусорку.','The official Razorpay extension for WooCommerce allows you to accept credit cards, debit cards, netbanking, wallet, and UPI payments.'=>'Официальное расширение Razorpay для WooCommerce позволяет вам принимать к оплате кредитные карты, дебетовые карты, производить расчёты с помощью банковских интернет-систем, электронных кошельков и UPI.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Параметры: &quot;Активно&quot; (доставляет нагрузку), &quot;Приостановлено&quot; (не доставляется), or &quot;Выключено&quot; (не доставляется по причине проблем с доставкой).','The order ID to process during checkout.'=>'Идентификатор заказа для обработки во время оформления заказа.','The order ID.'=>'ID заказа.','The order note ID provided is not associated with the order'=>'Указанный ID заметки к заказу не ассоциирован с заказом','The order refund ID provided is not associated with the order.'=>'Указанный ID возврата не связан с заказом','The order totals have been updated. Please confirm your order by pressing the "Place order" button at the bottom of the page.'=>'Итоговая сумма заказа обновлена. Пожалуйста, подтвердите заказ нажатием на кнопку "Разместить заказ" внизу страницы.','The parent theme developers URL.'=>'URL разработчика родительской темы.','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs.'=>'Расширение PayFast для WooCommerce позволяет принимать платежи по банковской карте и путем безналичных переводов через один из самых популярных платёжных шлюзов в Южной Африке. Вам не потребуется платить за установку или ежемесячно оплачивать подписку.','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Расширение PayFast для WooCommerce позволяет принимать платежи по кредитной карте и безналичным переводом через популярный в Южной Африке платёжный шлюз. Вам не потребуется платить за установку или ежемесячно оплачивать подписку.  При выборе этого расширения в качестве валюты в магазине будет использоваться Южноафриканский рэнд.','The payment gateway for this order does not exist.'=>'Платежного шлюза для этого заказа не существует.','The payment gateway for this order does not support automatic refunds.'=>'Платёжный шлюз, использованный при обработке заказа не поддерживает автоматический возврат средств.','The plugin could not be activated.'=>'Не удалось активировать плагин.','The position of the currency symbol.'=>'Позиция символа валюты.','The postal code, if any, in which your business is located.'=>'Почтовый индекс, если есть, для вашего магазина.','The previous status of order %1$d ("%2$s") is invalid. It could not be restored.'=>'Предыдущий статус заказа %1$d ("%2$s") недействителен. Его восстановить невозможно.','The previous status of order %1$d ("%2$s") is invalid. It has been restored to "pending" status instead.'=>'Предыдущий статус заказа %1$d ("%2$s") недействителен. Он был переведён в статус "на утверждении".','The product review cannot be deleted.'=>'Отзыв товара не может быть удалён.','The product review does not support trashing.'=>'Отзывы на товары не поддерживают удаление в мусорку.','The product variation is invalid'=>'Вариация товара некорректная','The provided email address (%s) is not valid—please provide a valid email address'=>'Указанный адрес электронной почты (%s) недействителен – укажите действующий адрес электронной почты','The provided email address is not valid'=>'Предоставленный Email недействителен','The provided handler %1$s does not implement %2$s.'=>'Предоставленный обработчик %1$s не выполняет %2$s.','The provided phone number is not valid'=>'Предоставленный телефон недействителен','The provided postcode / ZIP is not valid'=>'Указан некорректный почтовый индекс','The provided state (%1$s) is not valid. Must be one of: %2$s'=>'Указанное состояние (%1$s) недопустимо. Допустимы: %2$s','The quantity added to the cart must be a multiple of %s'=>'Количество, добавленное в корзину, должно быть кратно %s.','The rate at which tax is applied.'=>'Применяемая ставка налога.','The requested plugin `%s` could not be activated.'=>'Требуемый плагин `%s` не может быть активирован.','The requested plugin `%s` could not be installed.'=>'Не удалось установить запрошенный плагин %s.','The requested plugin `%s` could not be installed. Plugin API call failed.'=>'Не удалось установить запрошенный плагин %s. Ошибка вызова API плагина.','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Невозможно установить требуемый плагин «%s». Сбой инструмента установки обновления.','The requested plugin `%s`. is not yet installed.'=>'Требуемый плагин «%s» ещё не установлен.','The requested theme `%s` could not be installed.'=>'Не удалось установить запрошенную тему %s.','The requested theme `%s` could not be installed. Theme API call failed.'=>'Не удалось установить запрошенную тему %s. Ошибка при вызове API темы.','The requested theme could not be activated.'=>'Запрашиваемая тема не может быть активирована.','The resource cannot be deleted.'=>'Этот ресурс не может быть удалён.','The response body from the receiving server.'=>'Тело ответа от принимающего сервера.','The Rest API is unavailable.'=>'Rest API недоступен.','The root URL of your site.'=>'Корневой URL вашего сайта.','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Распродажа стартует в 00:00:00 в день "С..." и завершится в 23:59:59 в день "По...".','The secret key is used to generate a hash of the delivered webhook and provided in the request headers.'=>'Секретный ключ используется для генерации хэша доставляемого вебзацепа и передаётся в заголовках запроса.','The selected product isn\'t a variation of %2$s, please choose product options by visiting <a href="%1$s" title="%2$s">%2$s</a>.'=>'Выбранный товар не является вариацией %2$s, выберите опции товара, открыв <a href="%1$s" title="%2$s">%2$s</a>.','The settings of this image size have been disabled because its values are being overwritten by a filter.'=>'Настройки размеров этого изображения были отключены, так как эти значения были перезаписаны фильтром.','The SKU already exists on another product.'=>'Такой артикул уже используется с другим товаром.','The slug for the resource.'=>'Ярлык для ресурса.','The specific chart this stat referrers to.'=>'Конкретный график, на который ссылается этот параметр.','The status of the coupon. Should always be draft, published, or pending review'=>'Статус купона. Всегда должен быть черновиком, опубликованным или в ожидании проверки','The status of the note (e.g. unactioned, actioned).'=>'Статус заметки (например, не обработано, выполнено действие).','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Данные по запасам не были обновлены, так как количество было изменено с момента редактирования. Товар %1$d имелся в количестве %2$d шт.','The street address for your business location.'=>'Почтовый адрес вашего магазина.','The term ID, or 0 if the attribute is not a global attribute.'=>'ID значения или 0, если атрибут не является глобальным.','The term name.'=>'Название значения.','The term slug.'=>'Ярлык значения.','The text to appear in the footer of all WooCommerce emails.'=>'Текст в подвале электронных писем WooCommerce.','The theme developers URL.'=>'URL разработчика темы.','The thousand separator of displayed prices.'=>'Тысячный разделитель при отображении цен.','The type of the note (e.g. error, warning, etc.).'=>'Тип заметки (например, ошибка, предупреждение и т. д.)','The unit lengths are defined in for this country.'=>'Единичные длины определены для этой страны.','The unit weights are defined in for this country.'=>'Объёмные веса определены для этой страны.','The URL of your %s page (along with the Page ID).'=>'URL-адрес вашей страницы %s (а также ID страницы).','The URL where the webhook payload is delivered.'=>'URL, куда доставлена нагрузка вебзацепа.','The URL where the webhook was delivered.'=>'URL, на который был доставлен вебзацеп.','The version of cURL installed on your server.'=>'Версия cURL, установленная на вашем сервере.','The version of MySQL installed on your hosting server.'=>'Версия MySQL, установленная на сервере вашего хостинга.','The version of PHP installed on your hosting server.'=>'Версия PHP, установленная на сервере вашего хостинга.','The version of WooCommerce installed on your site.'=>'Версия WooCommerce, установленная на вашем сайте.','The version of WordPress installed on your site.'=>'Версия WordPress, используемая на вашем сайте.','The WooCommerce Blocks feature plugin requires a more recent version of WordPress and has been paused. Please update WordPress to continue enjoying WooCommerce Blocks.'=>'Плагин WooCommerce Blocks требует более новой версии WordPress, поэтому его работа была приостановлена. Чтобы продолжить использовать WooCommerce Blocks, обновите WordPress.','The WooCommerce Blocks package running on your site.'=>'Пакет WooCommerce Blocks уже работает на вашем сайте.','The WooCommerce Blocks plugin requires a more recent version of WooCommerce and has been deactivated. Please update to the latest version of WooCommerce.'=>'Для плагина WooCommerce Blocks требуется более новая версия WooCommerce, поэтому он был деактивирован. Обновите WooCommerce до последней версии.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Плагин WooCommerce Helper больше не нужен. <a href="%s">Для управления подписками</a> переходите во вкладку «Расширения».','The WooCommerce REST API allows external apps to view and manage store data. Access is granted only to those with valid API keys.'=>'API-интерфейс WooCommerce REST позволяет просматривать и изменять настройки магазина с помощью сторонних приложений. Доступ предоставляется только приложениям с действительными API-ключами.','The WooCommerce REST API package running on your site.'=>'Пакет WooCommerce REST API работает на этом сайте.','Theme'=>'Тема','Theme author URL.'=>'URL автора темы.','Theme installation message.'=>'Тема установки сообщения.','Theme installation status.'=>'Тема установки статуса.','Theme name.'=>'Название темы.','Theme slug.'=>'Строка темы.','Theme status.'=>'Статус темы.','Theme version.'=>'Версия темы.','Theme.'=>'Тема.','There are currently no logs to view.'=>'Сейчас здесь нет журналов для просмотра.','There are no currencies matching these parameters.'=>'Нет валют, соответствующих этим параметрам.','There are no locations matching these parameters.'=>'Нет местоположений, соответствующих этим параметрам.','There are no notes yet.'=>'Заметок пока нет.','There are no orders to sync, aborting.'=>'Нет заказов для переноса, отбой.','There are no orders to verify, aborting.'=>'Нет заказов для проверки, выполняется отмена.','There are no product reviews yet.'=>'Отзывов о товарах ещё нет.','There are no reviews yet.'=>'Отзывов пока нет.','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'Нет доступных способов доставки. Пожалуйста, убедитесь, что вы ввели корректный адрес, или свяжитесь с нами для получения помощи.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'%s заканчиваются на складе. Уменьшите количество в вашей корзине.','There are some issues with the items in your cart. Please go back to the cart page and resolve these issues before checking out.'=>'Возникли проблемы с товарами в вашей корзине. Пожалуйста, вернитесь на страницу корзины и решите эти проблемы перед оформлением заказа.','There are three ways to add your products: you can <strong>create products manually, import them at once via CSV file</strong>, or <strong>migrate them from another service</strong>.<br/><br/>'=>'Есть три способа добавлять товары: вы можете <strong>создавать их вручную, импортировать все сразу с помощью файла CSV</strong> или <strong>перенести их из другой платформы</strong>.<br/><br/>','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'В корзине слишком много %s. пожалуйста уменьшите количество в корзине до 1.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'В корзине слишком много %s. пожалуйста уменьшите количество каждого товара в корзине до 1.','There are too many concurrent batches, but the run is forced to continue.'=>'Существует слишком много параллельных пакетов, но выполнение принудительно продолжается','There are too many concurrent batches.'=>'Слишком много параллельных пакетов.','There is %1$d order to be synced.'=>'Есть %1$d заказ для переноса.' . "\0" . 'Есть %1$d заказа для переноса.' . "\0" . 'Есть %1$d заказов для переноса.','There is %1$d order to be verified.'=>'Есть %1$d заказ для проверки.' . "\0" . 'Заказов для проверки: %1$d.' . "\0" . 'Заказов для проверки: %1$d.','There is no data to export for the given request.'=>'Нет данных для экспорта по данному запросу.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'%s заканчивается на складе. Уменьшите количество в вашей корзине.','There was a failure fetching this action'=>'Не удалось получить это действие','There was a failure fetching this action: %s'=>'Не удалось получить это действие %s','There was a failure scheduling the next instance of this action: %s'=>'Произошла ошибка при планировании следующего экземпляра этого действия: %s','There was a problem activating some of the requested plugins.'=>'При активации некоторых требуемых плагинов возникла проблема.','There was a problem installing some of the requested plugins.'=>'При установке некоторых требуемых плагинов возникла проблема.','There was a problem with the provided %s:'=>'Возникла проблема с предоставленным %s:','There was an error calling %1$s: %2$s'=>'Произошла ошибка вызова %1$s: %2$s','There was an error calling %s'=>'Произошла ошибка вызова %s','There was an error calling this tool. There is no callback present.'=>'При вызове этой службы произошла ошибка. Нет обратного вызова.','There was an error communicating with the WooCommerce Payments plugin.'=>'При подключении плагина WooCommerce Payments.','There was an error connecting to Square.'=>'Произошла ошибка при подключении Square.','There was an error connecting to WooCommerce.com. Please try again.'=>'Произошла ошибка при подключении WooCommerce.com. Повторите попытку.','There was an error generating your API Key.'=>'При создании ключа API произошла ошибка.','There was an error loading the WooCommerce.com Helper API.'=>'При загрузке вспомогательного API WooCommerce.com произошла ошибка.','There was an error running the action scheduler: %s'=>'В процессе работы планировщика действий произошла ошибка: %s','There was an error with an item in your cart.'=>'Произошла ошибка с товаром в вашей корзине.','There was an issue loading the report endpoints'=>'При загрузке эндпоинтов отчёта возникла проблема.','There\'s %1$s order (out of a total of %2$s) pending sync!'=>'Не синхронизирован %1$s заказ (из %2$s)!' . "\0" . 'Не синхронизированы %1$s заказа (из %2$s)!' . "\0" . 'Не синхронизированы %1$s заказов (из %2$s)!','There\'s %s order pending sync!'=>'Не синхронизирован %s заказ!' . "\0" . 'Не синхронизированы %s заказа!' . "\0" . 'Не синхронизированы %s заказов!','These are regions inside this zone. Customers will be matched against these regions.'=>'Следующие регионы входят в зону. Клиенты будут сопоставляться с этими регионами.','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Эти цены могут быть опционально добавлены в соответствии с <a href="%s">классом доставки товара</a>.','These features are either experimental or incomplete, enable them at your own risk!'=>'Этот функционал является либо экспериментальным, либо неполным. Включайте его на свой страх и риск!','These options let you change the appearance of the WooCommerce checkout.'=>'Эти функции позволяют изменить внешний вид страницы оформления заказа WooCommerce.','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Эти страницы нужны для того, чтобы система могла перенаправлять пользователей к оформлению заказа.','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Дополнительные опции доставки, имеющие дополнительную цену (основано на единой ставке).','These settings are not available while the lookup table regeneration is in progress.'=>'Эти настройки недоступны во время регенерации таблицы обзора.','Thessaly'=>'Фессалия','Things to do next'=>'Что делать дальше','This %s cannot be deleted'=>'%s не может быть удалён','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Это действие не может быть отменено. Вы уверены, что хотите удалить персональные данные из выбранных заказов?','This controls how stock quantities are displayed on the frontend.'=>'Здесь вы можете настроить, как количество товара в наличии будет отображаться во внешнем интерфейсе.','This controls the description which the user sees during checkout.'=>'Описание, которое видит пользователь при оформлении заказа.','This controls the position of the currency symbol.'=>'Управляет положением символа валюты.','This controls the title which the user sees during checkout.'=>'Заголовок, который видит пользователь в процессе оформления заказа.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Эти настройки позволяют определить в какой валюте перечислены цены в каталоге и какие платежные шлюзы будут использоваться.','This controls what unit you will define lengths in.'=>'Здесь определяется единица измерения, в которой определяется длина.','This controls what unit you will define weights in.'=>'Здесь определяется единица измерения, в которой определяется вес.','This controls which shipping address is used by default.'=>'Здесь определяется какой адрес доставки будет использоваться по умолчанию.','This coupon has expired.'=>'Время действия этого промокода истекло.','This data will be deleted in %s.'=>'Эти данные будут удалены в %s.','This email address is already registered.'=>'Этот адрес e-mail уже зарегистрирован.','This feature is not production ready yet. Make sure you are not running these commands in your production environment.'=>'Эта функция еще не готова к использованию. Убедитесь, что вы не выполняете эти команды в рабочей среде.','This field allows you to set the maximum spend (subtotal) allowed when using the coupon.'=>'Это поле позволяет установить максимальную сумму, необходимую для применения купона.','This field allows you to set the minimum spend (subtotal) allowed to use the coupon.'=>'Это поле позволяет установить минимальную сумму, необходимую для применения купона.','This function should not be called before plugins_loaded.'=>'Эта функция не должна вызываться до события plugins_loaded.','This function should not be called before woocommerce_init.'=>'Эта функция не должна быть вызвана перед woocommerce_init.','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Это демо-магазин для тестирования &mdash; заказы не исполняются.','This is a featured product'=>'Это рекомендуемый товар','This is an order notification sent to customers containing order details after an order is placed on-hold from Pending, Cancelled or Failed order status.'=>'Это уведомление содержит детали заказа и отправляется клиенту после того, как заказ переведён в состояние ожидания, отменён или не выполнен.','This is an order notification sent to customers containing order details after payment.'=>'Это уведомление содержит детали заказа и отправляется клиенту после оплаты.','This is not your download link.'=>'Это не ваша ссылка на загрузку.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Это ID вложения или URL изображения, используемый для заполнителей в каталоге продукции. Они будут использоваться для товаров без изображения.','This is the default category and it cannot be deleted. It will be automatically assigned to products with no category.'=>'Это категория по умолчанию, и её нельзя удалить. Она автоматически присваивается товарам без категории.','This is the name of the download shown to the customer.'=>'Это название загрузки которое будет показано клиенту.','This is the name of the zone for your reference.'=>'Это название зоны.','This is the sum of the "Tax rows" shipping tax amount within your orders.'=>'Это сумма "Налоговых Ставок" налогов на доставку в пределах ваших заказов.','This is the sum of the "Tax rows" tax amount within your orders.'=>'Это сумма "Налоговых Ставок" в пределах ваших заказов.','This is the sum of the \'Order total\' field within your orders.'=>'Это сумма поля "Общий заказ" внутри Ваших заказов.','This is the sum of the \'Shipping total\' field within your orders.'=>'Это сумма поля "Общий итог по доставкам" внутри Ваших заказов.','This is the sum of the order totals after any refunds and excluding shipping and taxes.'=>'Это итоговая сумма заказа после всех возвратов и исключая расходы на доставку и налоги.','This is the sum of the order totals after any refunds and including shipping and taxes.'=>'Это итоговая сумма всех заказов, включая доставку и налоги, после учета возвратов. ','This is the total tax for the rate (shipping tax + product tax).'=>'Это общая сумма налога для ставки (налоги на доставку + налог на товар).','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'Это URL или абсолютный путь к файлу, по которому клиент получит доступ к нему. Адреса уже должны быть закодированы.','This is the WooCommerce shop page. The shop page is a special archive that lists your products. <a href="%s">You can read more about this here</a>.'=>'Это страница магазина WooCommerce. Страница магазина это специальный архив со списком товаров. Подробнее об этом можно прочитать <a href="%s">здесь</a>.','This is where store orders are stored.'=>'Здесь хранятся заказы.','This is where you can add new coupons that customers can use in your store.'=>'Здесь можно добавить новые купоны, которые пользователи смогут использовать в магазине.','This is where you can browse products in this store.'=>'Здесь вы можете просматривать товары данного магазина.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Место где расположен ваш бизнес. Расчёт налогов и стоимости доставки будет производиться учитывая данный адрес.','This item is already in the cart and its quantity cannot be edited'=>'Этот товар уже в корзине и его количество нельзя изменить.','This key is invalid or has already been used. Please reset your password again if needed.'=>'Ваш ключ неверен или уже был использован. Пожалуйста снова сбросьте ваш пароль если нужно.','This lets you choose which products are part of this group.'=>'Здесь вы можете выбрать, какие товары входят в эту группу.','This means that the table is probably in an inconsistent state. It\'s recommended to run a new regeneration process or to resume the aborted process (Status - Tools - Regenerate the product attributes lookup table/Resume the product attributes lookup table regeneration) before enabling the table usage.'=>'Это означает, что данная таблица, вероятно, несогласована. Перед включением использования таблицы рекомендуется запустить новый процесс регенерации или возобновить прерванный (раздел Статус > Инструменты > Регенерировать таблицу обзора атрибутов товараа/Возобновить регенерацию таблицы обзора атрибутов товара).','This method is deprecated in 2.6.0 and will be removed in future versions - we recommend disabling it and instead setting up a new rate within your <a href="%s">Shipping zones</a>.'=>'<strong>Этот метод устарел в версии 2.6.0 и будет удалён в следующих версиях - мы рекомендуем отключить его и взамен настроить новую ставку, задействуя <a href="%s">Зоны доставки</a>.</strong>','This method should not be called before plugins_loaded.'=>'Этот метод не должен вызываться до события plugins_loaded','This month'=>'Этот месяц','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'Эта опция определяет местоположение клиентов по умолчанию. База данных MaxMind GeoLite будет периодически загружаться в вашу директорию wp-content, если геолокация используется.','This option determines which address is used to calculate tax.'=>'Определяет какой адрес будет использоваться для расчёта налога.','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Данная опция имеет важное значение, так как она определяет каким образом будут вводиться цены. Изменение не влияет на существующие товары.','This option lets you limit which countries you are willing to sell to.'=>'Опция позволяет ограничить страны, в которых вы собираетесь продавать.','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Эта опция удалит ВСЕ ваши налоговые ставки, используйте с осторожностью. Это действие не может быть отменено.','This order cannot be paid for. Please contact us if you need assistance.'=>'Этот заказ не может быть оплачен. Пожалуйста обратитесь к нам если вам нужна помощь.','This order is no longer editable.'=>'Этот заказ больше недоступен для редактирования.','This order note cannot be deleted'=>'Примечание к заказу не может быть удалено','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'Состояние заказа &ndash; &ldquo;%s&rdquo; и он не может быть оплачен. Пожалуйста, обратитесь к администрации магазина.','This password reset key is for a different user account. Please log out and try again.'=>'Данный ключ для смены пароля предназначен для другой учетной записи пользователя. Выйдите из системы и повторите попытку.','This payment method was successfully set as your default.'=>'Этот метод оплаты установлен по умолчанию.','This product cannot be added to the cart.'=>'Этот товар нельзя добавить в корзину.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Этот товар продавался и может быть связан с существующими заказами. Вы уверены, что хотите его удалить?','This product is currently out of stock and unavailable.'=>'Этого товара нет в наличии, заказ недоступен.','This product is protected and cannot be purchased.'=>'Этот товар защищён и не может быть куплен.','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'Срок действия этой ссылки на отчет истёк. %1$sЩёлкните здесь для просмотра отфильтрованного отчёта%2$s.','This resource cannot be created.'=>'Невозможно создать ресурс.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Этот образец содержит основную информацию о том, какие персональные данные ваш магазин может собирать, хранить и передавать третьей стороне, а также о том, кто может получить доступ к этим данным. Информация относительно вашего магазина может отличаться в зависимости от вашего региона деятельности и используемых настроек и плагинов. Рекомендуем проконсультироваться с юристом о том, какие сведения следует раскрывать в вашей политике конфиденциальности.','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'В этом разделе можно настроить отображение политики конфиденциальности вашего сайта. Уведомления о защите конфиденциальной информации, приведённые ниже, не будут отображаться, если %s не настроена.','This section lets you customize the WooCommerce emails. <a href="%s" target="_blank">Click here to preview your email template</a>.'=>'Этот раздел позволяет настраивать Email\'ы WooCommerce. <a href="%s" target="_blank">Кликните сюда, чтобы просмотреть ваш Email-шаблон</a>.','This section shows any files that are overriding the default WooCommerce template pages.'=>'Этот раздел показывает файлы, которые отличаются от шаблона WooCommerce по умолчанию.','This section shows details of Action Scheduler.'=>'В этом разделе показаны сведения о планировщике действий.','This section shows details of WC Admin.'=>'В этом разделе отображаются сведения об администраторе WC.','This section shows information about this status report.'=>'В этом разделе отображается информация об отчёте о состоянии.','This sets the base page of your shop - this is where your product archive will be.'=>'Установка основной страницы вашего магазина — здесь будет располагаться архив товаров.','This sets the decimal separator of displayed prices.'=>'Устанавливает разделитель дробной части в отображаемых ценах.','This sets the number of decimal points shown in displayed prices.'=>'Определяет количество знаков после целого, в отображаемых ценах.','This sets the thousand separator of displayed prices.'=>'Определяет разделитель тысяч в отображаемых ценах.','This setting determines which shop pages products will be listed on.'=>'Эта настройка определяет, на каких страницах магазина будут отображены товары.','This setting does not apply to guest purchases.'=>'Эти настройки не применяются на гостевые покупки.','This shipping method does not have any settings to configure.'=>'Этот метод доставки не имеет настраиваемых параметров.','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'Эта подписка истекла. Сообщите владельцу что нужно <strong>обновить</strong> подписку для дальнейшего получения обновлений и поддержки.','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'Эта подписка истекла. Пожалуйста <strong>обновите её</strong> чтобы и далее получать обновления и поддержку.','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'Срок действия этой подписки скоро закончится. <strong>Продлите</strong> её, чтобы и дальше получать обновления и поддержку.','This template has been overridden by your theme and can be found in: %s.'=>'Этот шаблон был переопределен вашей темой и может быть найден здесь: %s.','This text will be shown on the button linking to the external product.'=>'Будет показан на кнопке, связанной с внешним товаром','This tool allows you to generate and download a CSV file containing a list of all products.'=>'Этот инструмент позволяет сгенерировать (и скачать) CSV файл со списком всех товаров.','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'Этот инструмент позволяет импортировать (или дописывать) данные товаров из CSV или TXT файла к вашему магазину.','This tool will abort the regenerate product attributes lookup table regeneration. After this is done the process can be either started over, or resumed to continue where it stopped.'=>'Этот инструмент прервёт регенерацию таблицы обзора атрибутов товара. После этого процесс можно либо начать заново, либо возобновить, чтобы продолжить с того места, где он был прерван.','This tool will clear ALL expired transients from WordPress.'=>'Этот инструмент очистит WordPress от истекших временных данных','This tool will clear the product/shop transients cache.'=>'Этот инструмент очистит кэш временных данных товаров/магазина.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Этот инструмент удаляет из базы данных всю информацию о сеансах пользователей, включая текущие и сохранённые корзины.','This tool will delete all variations which have no parent.'=>'Этот механизм удалит все вариации, не имеющие родительского товара.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Этот инструмент удаляет разрешения, для которых истёк срок действия или не осталось доступных загрузок.','This tool will empty the template cache.'=>'Этот инструмент позволяет очистить кэш шаблона.','This tool will install all the missing WooCommerce pages. Pages already defined and set up will not be replaced.'=>'Эта служба установит все недостающие страницы WooCommerce. Ранее определенные и настроенные страницы не будут заменены.','This tool will recount product terms - useful when changing your settings in a way which hides products from the catalog.'=>'Этот инструмент пересчитает значения товаров — полезно при изменении настроек, в результате которых товары скрываются из каталога.','This tool will regenerate product lookup table data. This process may take a while.'=>'Этот инструмент регенерирует данные таблицы обзора товара. Это может занять некоторое время.','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Этот механизм регенерирует данные таблицы обзора атрибутов товара из данных существующих товаров. Данный процесс может занять некоторое время.','This tool will reset the admin, customer and shop_manager roles to default. Use this if your users cannot access all of the WooCommerce admin pages.'=>'Этот инструмент сбросит параметры прав администратора, клиента и shop_manager. Используйте это, если пользователи не могут получить доступ к страницам управления WooCommerce.','This tool will reset the cached values used in WooCommerce Analytics. If numbers still look off, try %1$sReimporting Historical Data%2$s.'=>'Этот инструмент сбросит все кешированные значения из Аналитики WooCommerce. Если цифры все еще кажутся неверными, попробуйте %1$sзаново импортировать архивные данные%2$s.','This tool will resume the product attributes lookup table regeneration at the point in which it was aborted (%1$s products were already processed).'=>'Этот инструмент возобновит регенерацию таблицы обзора атрибутов товара с того момента, когда она была прервана (количество обработанных товаров: %1$s).','This tool will update your WooCommerce database to the latest version. Please ensure you make sufficient backups before proceeding.'=>'Это средство установит актуальную версию базы данных WooCommerce. Прежде чем продолжить, сделайте достаточное количество резервных копий.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Это обучающее видео поможет вам добавить в WooCommerce первый товар.','This will be how your name will be displayed in the account section and in reviews'=>'Так ваше имя будет отображаться в разделе аккаунта и при публикации отзывов','This will change the stock status of all variations.'=>'Это приведет к изменению состояния запасов для всех вариантов.','This will give "%1$s" %2$s access which will allow it to:'=>'"%1$s" получит доступ уровня %2$s, который позволит:','This will regenerate all shop thumbnails to match your theme and/or image settings.'=>'Это регенерирует все миниатюры магаз