к перед запуском.','To manipulate product variations you should use the /products/&lt;product_id&gt;/variations/&lt;id&gt; endpoint.'=>'Для управления вариациями товаров нужно использовать эндпойнт /products/&lt;product_id&gt;/variations/&lt;id&gt;.','To opt out, leave this box unticked. Your store remains untracked, and no data will be collected. Read about what usage data is tracked at: %s.'=>'При отключенной опции отслеживание не производится и данные не собираются. %s.','To override and edit this email template copy %1$s to your theme folder: %2$s.'=>'Чтобы переопределить и отредактировать этот шаблон письма, скопируйте %1$s в папку темы: %2$s.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Для получения обновлений и поддержки по этому расширению, вам требуется <strong>купить</strong> новую подписку, или объединить все расширения на одной учетной записи <strong><a href="%1$s" title="Документация по совместному использованию">совместного использования</a> или <a href="%2$s" title="Документация по переносу">перенести</a></strong> расширение на эту подключенную учетную запись.','To set your password, visit the following address: '=>'Чтобы задать пароль, перейдите по следующей ссылке:','To start growing your business, head over to <a href="%s">WooCommerce.com</a>, where you\'ll find the most popular WooCommerce extensions.'=>'Чтобы приступить к развитию своего бизнеса, посетите <a href="%s">WooCommerce.com</a>, где вы найдёте популярные расширения WooCommerce.','To track your order please enter your Order ID in the box below and press the "Track" button. This was given to you on your receipt and in the confirmation email you should have received.'=>'Для отслеживания вашего заказ