r information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Обычно мы храним данные о вас столько, сколько необходимо для целей, ради которых мы их собираем и используем. Исключение составляют случаи, когда мы обязаны продолжать хранить эту информацию в связи с требованиями законодательства. Так, информация о заказе хранится у нас на протяжении XX лет, согласно правилам налогообложения и бухгалтерского учёта. К этим сведениям относится ваше имя, адрес электронной почты, адрес выставления счёта и адрес доставки.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Мы создали для вас образец страницы возврата. Пожалуйста, посмотрите и обновите его содержимое, чтобы оно соответствовало процессам вашей компании.','We have finished processing your order.'=>'Мы завершили обработку вашего заказа.','We hope to see you again soon.'=>'Надеемся вскоре снова вас увидеть.','We look forward to fulfilling your order soon.'=>'Надеемся скоро выполнить ваш заказ.','We look forward to seeing you soon.'=>'До скорой встречи.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Мы заметили, что во время установки плагинов Jetpack и WooCommerce Shipping & Tax возникла проблема. Повторите попытку и воспользуйтесь всеми преимуществами подключаемых плагинов для магазина! Извините за неудобства. Эти плагины будут установлены и активированы бесплатно.','We recommend Storefront, the <em>official</em> WooCommerce theme.'=>'Мы рекомендуем Storefront, <em>официальную</em> тему для WooCommerce.','We recommend using PHP version 7.2 or above for greater performance and security.'=>'Для повышения производительности и безопасности рекомендуется использовать версию PHP не ниже 7.2.','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Для экономии времени в процессе оформления посылок в почтовом отделении, рекомендуем напечатать транспортные этикетки дома, с помощью ShipStation. Используйте ShipStation бесплатно в течение 30 дней.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Мы передаём информацию нашим партнёрам, которые помогают нам выполнять ваши заказы и предоставлять услуги по продаже товаров. Среди них:..','We show contextual suggestions for official extensions that may be helpful to your store.'=>'WooCommerce предлагает контекстные рекомендации официальных расширений, которые могут пригодиться в вашем магазине.','We strongly recommend creating a backup of your site before updating.'=>'Настоятельно рекомендуем создать резервную копию сайта перед обновлением.','We were unable to process your order, please try again.'=>'Мы не смогли обработать ваш заказ. Пожалуйста, попробуйте ещё раз.','We will also store comments or reviews, if you choose to leave them.'=>'Также мы храним ваши комментарии и отзывы на товары.','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Использовать %1$s для массы товара и %2$s для габаритов.','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Мы рады помогать вам — получайте советы, информацию об обновлении товаров и вдохновляющие идеи прямо на почту.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Мы создали две зоны доставки - только %s и остальная часть мира. Ниже вы можете указать стоимость доставки по единой ставке для этих зон или предложить бесплатную доставку.','We\'ve made things simpler and easier to manage moving forward. From now on you can manage all your WooCommerce purchases directly from the Extensions menu within the WooCommerce plugin itself. <a href="%s">View and manage</a> your extensions now.'=>'Мы упростили всё, что могли, чтобы идти вперёд стало легче. Теперь вы сможете управлять всеми покупками в WooCommerce прямо из меню «Расширения» плагина WooCommerce. <a href="%s">Просмотреть и управлять</a> расширениями прямо сейчас.','Webhook actions'=>'Действия вебзацепа','Webhook created on %s'=>'Вебзацеп создан %s','Webhook created on date parsed by DateTime::formatM d, Y @ h:i A'=>'d.m.Y H:i','Webhook created successfully.'=>'Вебзацеп успешно создан.','Webhook data'=>'Данные вебзацепа','Webhook delivery URL must be a valid URL starting with http:// or https://'=>'URL доставки вебзацепа должен начинаться с http:// или https://!','Webhook delivery URL must be a valid URL starting with http:// or https://.'=>'URL доставки вебзацепа должен начинаться с http:// или https://.','Webhook delivery URL.'=>'URL доставки вебзацепа.','Webhook event.'=>'Событие вебзацепа.','Webhook resource.'=>'Ресурс вебзацепа.','Webhook status must be valid.'=>'Статус вебзацепа должен быть корректным.','Webhook status.'=>'Статус вебзацепа.','Webhook topic is required and must be valid.'=>'Тема вебзацепа обязательна для заполнения.','Webhook topic must be valid.'=>'Тема вебзацепа должна быть валидной.','Webhook topic unknown. Please select a valid topic.'=>'Неизвестная тема вебзацепа. Выберите допустимую тему.','Webhook topic.'=>'Тема вебзацепа.','Webhook updated successfully.'=>'Вебзацеп обновлён.','Webhooks'=>'Вебзацепы','Webhooks are event notifications sent to URLs of your choice. They can be used to integrate with third-party services which support them.'=>'Вебзацепы - это уведомления о событиях, отправляемые на выбранные URL. С помощью вебзацепов можно интегрировать сторонние службы, которые их поддерживают.','Webhooks do not support trashing.'=>'Вебзацепы