 you plan to sell?'=>'Какого типа товары вы планируете продавать?','What we collect and store'=>'Какие данные мы собираем и храним','What we share with others'=>'Какие данные мы передаём третьим сторонам','What would you like to charge for flat rate shipping?'=>'Какой счёт вы желаете выставлять за доставку по единой ставке?','What ZIP/post codes are available for local delivery?'=>'Для каких почтовых индексов применима местная доставка?','What ZIP/post codes are available for local pickup?'=>'Для каких почтовых индексов допустим самовывоз?','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'При использовании нескольких купонов, применять первый купон к полной стоимости, второй купон к уже сниженной и так далее.','When creating an account, automatically generate an account username for the customer based on their name, surname or email'=>'При создании аккаунта автоматически генерируется имя пользователя, основанное на имени, фамилии или адресе электронной почты.','When creating an account, send the new user a link to set their password'=>'Отправка пользователю ссылки для установки пароля при создании новой учётной записи','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'При обработке %s, должен ли доступ к скачиваемым файлам быть закрыт, а журналы скачивания очищены?','When handling an %s, should personal data within orders be retained or removed?'=>'При обработке %s, должны ли персональные данные по заказам быть сохранены или удалены?','When limiting response using after/before, which date column to compare against.'=>'Если при ограничении ответа вы указываете значения «до» и «после», укажите колонку дат и с чем ее сравнивать.','When product stock reaches this amount the stock status will change to "out of stock" and you will be notified via email. This setting does not affect existing "in stock" products.'=>'Когда количество товара в наличии дойдет до этой отметки, статус товара поменяется на «Нет в наличии» и вы получите уведомление на почту. Эта настройка не повлияет на товары, которые сейчас имеют статус «В наличии».','When product stock reaches this amount you will be notified by email. It is possible to define different values for each variation individually. The shop default value can be set in Settings > Products > Inventory.'=>'Когда запас товара достигнет этого количества, вы получите уведомление по электронной почте. Можно определить разные значения для каждого варианта индивидуально. Стандартное значение для всего магазина можно установить в разделе Настройки > Товары > Запасы.','When product stock reaches this amount you will be notified via email.'=>'Когда количество товара в наличии дойдет до этой отметки, вы получите уведомление на почту.','When true, email a link to download the export to the requesting user.'=>'Если установлено значение "true", отправляет ссылку на загрузку экспорта запрашивающему пользователю.','When true, refunded items are restocked.'=>'Если подтверждено, возвращённые товары пополняются.','When true, the payment gateway API is used to generate the refund.'=>'Когда этот параметр имеет значение TRUE, возмещение производится через API-интерфейс платежной системы.','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Когда запас вариации товара достигнет этого количества, вы получите уведомление по электронной почте. Стандартное значение для всех вариаций можно установить на вкладке запасов товара. Значение магазина по умолчанию можно установить в разделе Настройки > Товары > Запасы.','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Если вы захотите совершить у нас покупку, от вас потребуется предоставить сведения, включая ваше имя, адрес выставления счетов, адрес доставки, адрес электронной почты, номер телефона, данные банковской карты или платёжные реквизиты, а также дополнительные сведения аккаунта, такие как имя пользователя и пароль. Мы используем эти сведения в следующих целях:','When you receive a new order, it will appear here.'=>'Все новые заказы будут появляться здесь.','Where is your store based?'=>'Где базируется ваш магазин?','Whether an order can be edited.'=>'Можно ли изменять заказ.','Whether an order needs payment, based on status and order total.'=>'Требуется ли оплата заказа на основании статуса и общей суммы заказа.','Whether an order needs processing before it can be completed.'=>'Требуется ли обработка заказа перед его выполнением.','Whether or not a user can request to be reminded about the note.'=>'Может ли пользователь запросить получение напоминаний о заметке.','Whether or not the profile was completed.'=>'Был ли профиль заполнен.','Whether or not the profile was skipped.'=>'Определяет, пропускать ли профиль.','Whether or not the store was connected to WooCommerce.com during the extension flow.'=>'Был ли магазин подключен к WooCommerce.com во время расширения.','Whether or not this is a compound rate.'=>'Является ли данная ставка сложной.','Whether or not this store agreed to receiving marketing contents from WooCommerce.com.'=>'Согласился ли этот магазин на получение маркетинговых материалов от WooCommerce.com.','Whether or not this store country is set via onboarding profiler.'=>'Указана страна для этого магазина в мастере установки или нет.','Whether or not this store was setup for a client.'=>'Был ли этот магазин настроен для клиента.','Whether or not this tax rate also gets applied to shipping.'=>'Применяется ли эта налоговая ставка также к доставке.','Whether or not you have WordPress Multisite enabled.'=>'Включена ли мультисайтовость вашего WordPress\'а.','Whether the product is visible in the catalog'=>'Видимость товара в каталоге','Whether to bypass trash and force deletion.'=>'Удалять навсегда, пропуская перемещение в мусорку.','Whether to consider GMT post dates when limiting response by published or modified date.'=>'Следует ли учитывать даты публикации по Гринвичу при ограничении ответа по дате публикации или изменения.','Whether to create a new user account as part of order processing.'=>'Нужно ли создать новую учетную запись пользователя в ходе обработки заказа.','Whether to hide resources not assigned to any products.'=>'Скрывать ли ресурсы, не относящиеся ни к одному из товаров.','Which columns should be exported?'=>'Какие столбцы должны быть экспортированы?','Which features are disabled?'=>'Какие функции отключены?','Which features are enabled?'=>'Какие функции включены?','Which product category should be exported?'=>'Какую категорию товаров нужно экспортировать?','Which product types should be exported?'=>'Какие типы товаров должны быть экспортированы?','While you visit our site, we’ll track:'=>'Когда вы посещаете наш сайт, мы сохраняем следующие сведения о вас:','Who on our team has access'=>'У каких членов команды магазина есть доступ','Wicklow'=>'Виклов','Width'=>'Ширина','Width (%s)'=>'Ширина (%s)','Wisconsin'=>'Висконсин','with first and last resultShowing %1$d&ndash;%2$d of %3$d result'=>'Отображение %1$d&ndash;%2$d из %3$d' . "\0" . 'Отображение %1$d&ndash;%2$d из %3$d' . "\0" . 'Отображение %1$d&ndash;%2$d из %3$d','With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site — no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.'=>'С помощью блоков можно отображать выбранные товары, категории, фильтры и другие элементы почти в любом месте сайта без шорткодов и изменения кода. Узнайте больше о том, как пользоваться каждым из них.','With the release of WooCommerce 4.0, these reports are being replaced. There is a new and better Analytics section available for users running WordPress 5.3+. Head on over to the <a href="%1$s">WooCommerce Analytics</a> or learn more about the new experience in the <a href="https://docs.woocommerce.com/document/woocommerce-analytics/" target="_blank">WooCommerce Analytics documentation</a>.'=>'После выхода WooCommerce 4.0 эти отчёты больше не предоставляются. Теперь пользователям WordPress 5.3+ доступен новый, улучшенный раздел «Аналитика». Перейдите к <a href="%1$s">Аналитике WooCommerce</a> или узнайте больше о новых возможностях из <a href="https://docs.woocommerce.com/document/woocommerce-analytics/" target="_blank">документации об аналитике WooCommerce</a>.','With WooCommerce Payments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies – with no setup costs or monthly fees – and you can now accept in-person payments with the Woo mobile app.'=>'Используя WooCommerce Payments, вы можете безопасно принимать карты основных платёжных систем, Apple Pay и оплату более чем в 100 валютах. Вам не потребуется платить за установку или ежемесячно оплачивать подписку. Кроме того, вы сможете принимать очные платежи с помощью мобильного приложения Woo.','With WooCommerce Payments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies. Track cash flow and manage recurring revenue directly from your store’s dashboard - with no setup costs or monthly fees.'=>'Используя WooCommerce Payments, можно безопасно принимать оплату с карт основных платёжных систем и Apple Pay более чем в 100 валютах. Отслеживайте денежные потоки и управляйте регулярными поступлениями напрямую из панели администратора своего магазина. Платить за подключение и обслуживание не требуется.','WooCommerce'=>'WooCommerce','woocommerce'=>'woocommerce','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s 