ns that are incompatible with currently enabled WooCommerce features.'=>'Вы просматриваете активные плагины, не совместимые с активированными на данный момент функциями WooCommerce.','You are viewing the active plugins that are incompatible with the \'%s\' feature.'=>'Вы просматриваете активные плагины, не совместимые с функцией «%s».','You attempted to edit an order that does not exist. Perhaps it was deleted?'=>'Попытка изменить несуществующий заказ. Может быть, она удалена?','You can add multiple shipping methods within this zone. Only customers within the zone will see them.'=>'Вы можете добавить несколько способов доставки в пределах этой зоны. Только клиенты в пределах зоны будут видеть их.','You can also:'=>'Вы также можете:','You can manually run queued updates here.'=>'Вы можете вручную запустить обновления из очереди здесь.','You can only have 1 %s in your cart.'=>'В корзину можно положить только 1 %s.','You cannot add &quot;%s&quot; to the cart because the product is out of stock.'=>'&quot;%s&quot; не помещается в корзину, так как этого товара нет в наличии.','You cannot add a new payment method so soon after the previous one. Please wait for %d second.'=>'Вы не можете добавить новый способ оплаты сразу после добавления предыдущего. Подождите %d сек.' . "\0" . 'Вы не можете добавить новый способ оплаты сразу после добавления предыдущего. Подождите %d сек.' . "\0" . 'Вы не можете добавить новый способ оплаты сразу после добавления предыдущего. Подождите %d сек.','You cannot add another "%s" to your cart.'=>'Вы не можете добавить «%s» в корзину ещё раз.','You cannot add that amount of &quot;%1$s&quot; to the cart because there is not enough stock (%2$s remaining).'=>'Невозможно приобрести &quot;%1$s&quot; в таком количестве, так как запасы данного товара ограничены (осталось %2$s).','You cannot add that amount to the cart &mdash; we have %1$s in stock and you already have %2$s in your cart.'=>'Вы не можете добавить это количество в корзину &mdash; у нас в н