от инструмент, необходимо решение WooCommerce 4.2 или более новой версии.','You personalized your store'=>'Вы придали индивидуальность своему магазину','You set up payments'=>'Вы настроили способы оплаты','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.'=>'Вы хотите, чтобы ваш каталог товаров с изображениями выглядели великолепно и соответствовали вашему бренду. Это руководство даст вам все необходимые советы, чтобы ваши товары отлично смотрелись в вашем магазине.','You will need to manually issue a refund through your payment gateway after using this.'=>'Вам будет нужно вручную выдать возврат через соответствующий платёжный шлюз после этого.','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'Вы почти там! После завершения настройки магазина вы сможете начать получать заказы.','You\'re invited to share your experience'=>'Приглашаем вас поделиться опытом','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooCommerce Payments.'=>'Остался один шаг до начала приёма платежей. Проверьте сведения о вашей компании, чтобы начать управлять транзакциями с помощью WooCommerce Payments.','You\'re ready to add products to your store.'=>'Теперь вы можете добавить товары в свой магазин.','You\'re ready to start selling!'=>'Вы готовы к старту продаж!','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Вы достигли уровня в 10 заказов! Посмотрите на свой прогресс. Для мотивации просмотрите некоторые истории успеха пользователей WooCommerce.','Your account was created successfully and a password has been sent to your email address.'=>'Учетная запись создана, пароль отправлен на ваш адрес электронной почты.','Your account was created successfully. Your login details have been sent to your email address.'=>'Ваша учетная запись создана. Данные для входа отправлены на ваш адрес электронной почты.','Your cart is currently empty!'=>'Сейчас ваша корзина пуста!','Your cart is currently empty.'=>'Ваша корзина пока пуста.','Your changed data will be lost if you leave this page without saving.'=>'Изменённые вами данные будут утеряны, если вы покинете эту страницу без сохранения.','Your changes have been saved.'=>'Ваши изменения сохранены.','Your changes were not saved. Please retry.'=>'Не удалось сохранить изменения. Попробуйте снова.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Ваш CSV должен включать столбцы в определенном порядке. %1$sНажмите для загрузки примера%2$s.','Your current password is incorrect.'=>'Ваш текущий пароль неверен.','Your installation of the WooCommerce Blocks feature plugin is incomplete. Please run %1$s within the %2$s directory.'=>'Ваша установка функционала WooCommerce Blocks не завершена. Пожалуйста, запустите %1$s в директории %2$s.','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, %1$splease refer to this document%2$s to set up your development environment.'=>'Ваша установка WooCommerce неполная. Если вы скачали WooCommerce из GitHub, пожалуйста, следуйте %1$sэтой инструкции%2$s по настройке среды разработки.','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, please refer to this document to set up your development environment: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment'=>'Ваша установка WooCommerce неполная. Если вы скачали WooCommerce из GitHub, пожалуйста следуйте этой инструкции по настройке среды разработки: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment','Your invoice for order #{order_number}'=>'Счет на оплату по заказу № {order_number}','Your latest {site_title} invoice'=>'Ваш последний счёт на {site_title}','Your order'=>'Ваш заказ','Your order can no longer be cancelled. Please contact us if you need assistance.'=>'Ваш заказ не может быть отменен. Пожалуйста, свяжитесь с нами, если вам нужна помощь.','Your order on %s has been partially refunded. There are more details below for your reference:'=>'Для вашего заказа на %s частично возвращены денежные средства. См. ниже дополнительную информацию для справки:','Your order on %s has been refunded. There are more details below for your reference:'=>'Для вашего заказа на %s возвращены денежные средства. См. ниже дополнительную информацию для справки:','Your order was cancelled.'=>'Ваш заказ отменен.','Your password has been reset successfully.'=>'Ваш пароль успешно сброшен.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Ваши личные данные будут использоваться для обработки ваших заказов, упрощения вашей работы с сайтом и для других целей, описанных в нашей %s.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Ваши личные данные будут использоваться для упрощения вашего дальнейшего взаимодействия с сайтом, управления доступом к вашему аккаунту и других целей, описанных в документе %s.','Your products are now being imported...'=>'Ваши товары сейчас импортируются...','Your rating'=>'Ваша оценка','Your Report Download'=>'Загрузка вашего отчёта','Your report file is being generated.'=>'Формируется файл вашего отчёта.','Your review'=>'Ваш отзыв','Your review is awaiting approval'=>'Ваш комментарий ожидает одобрения','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Ваш сервер не имеет включенных fsockopen или cURL — PayPal IPN и другие скрипты, которые связываются с другими серверами, не будут работать. Свяжитесь со своим хостинг провайдером.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'На вашем сервере не обнаружен установленный класс %s, без DOMDocument не работают электронные письма HTML/Multipart и некоторые расширения.','Your server does not have the %s class enabled - some gateway plugins which use SOAP may not work as expected.'=>'На вашем сервере не включён класс %s - некоторые плагины шлюзов, использующие SOAP могут не работать как ожидалось.','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'Ваш сервер не поддерживает функцию %s - она необходима для использования базы данных GeoIP от MaxMind.','Your server does not support the %s functions - this is required for better character encoding. Some fallbacks will be used instead for it.'=>'Ваш сервер не поддерживает функции %s - это необходимо для лучшего кодирования символов. Некоторые откаты будут использованы вместо этого.','Your settings have been saved.'=>'Ваши настройки сохранены.','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Ваш сайт, возможно, находится в частной сети. Jetpack может подключаться только к общедоступным сайтам. Убедитесь, что ваш сайт доступен из Интернета, и попытайтесь подключиться снова 🙏.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Адрес магазина необходим, чтобы установить страну для настройки доставки, валюты и платежей.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Похоже, ваш магазин не использует защищённое соединение. Настоятельно рекомендуем настроить доступ ко всему вашему сайту через HTTPS-соединение, чтобы защитить данные клиентов. <a href="%s">Читайте об этом здесь.</a>','Your store is almost ready! To activate services like %s, just connect with Jetpack.'=>'Ваш магазин почти готов! Чтобы активировать сервисы, как %s, просто подключите Jetpack.','Your store is already connected.'=>'Ваш магазин уже подключён.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Ваш магазин настроен для размещения цифровых товаров методом «только переадресация». Этот метод устарел, <a href="%s">вам необходимо переключиться на другой метод</a>.<br><em>Если вы используете отдалённый сервер для загрузки файлов (например, Google Диск, Dropbox, Amazon S3), при желании вы можете «разрешить использование переадресации в крайнем случае». При включении этого параметра и/или выборе любого другого параметра это уведомление исчезнет.</em>','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Ваш магазин не подключен к WooCommerce.com. Выполните команду "wp wc com connect".','Your store is not using HTTPS. <a href="%s" target="_blank">Learn more about HTTPS and SSL Certificates</a>.'=>'В вашем магазине не используется HTTPS. <a href="%s" target="_blank">Подробнее об HTTPS и SSL-сертификатах</a>.','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Каталог загрузок магазина <a href="%1$s">открыт для просмотра в Интернете</a>. Мы настоятельно рекомендуем <a href="%2$s">настроить на веб-сервере блокировку индексации каталога</a>.','Your subscription expired on %s. Get a new subscription to continue receiving updates and access to support.'=>'Срок действия вашей подписки истек %s. Получите новую подписку, чтобы продолжить получать обновления и доступ к поддержке.','Your subscription expires in %d days. Enable autorenew to avoid losing updates and access to support.'=>'Срок действия вашей подписки истекает через %d дней. Включите автообновление, чтобы избежать потери обновлений и доступа к поддержке.','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'В вашей теме содержится файл woocommerce.php, вы не сможете переопределить кастомный шаблон woocommerce/archive-product.php с тех пор, как woocommerce.php получил приоритет над archive-product.php. Это предотвращает проблемы с отображением.','Your {site_title} account has been created!'=>'Ваш аккаунт на {site_title} создан!','Your {site_title} order #{order_number} has been partially refunded'=>'Ваш заказ на сайте {site_title} № {order_number} был частично возвращён','Your {site_title} order #{order_number} has been refunded'=>'Ваш заказ на сайте {site_title} № {order_number} был возвращен','Your {site_title} order has been received!'=>'Ваш заказ на сайте {site_title} оформлен!','Your {site_title} order is now complete'=>'Ваш заказ на сайте {site_title} выполнен','You’ve received the following order from %s:'=>'Получен заказ от покупателя %s:','Yozgat'=>'Йозгат','Yucatán'=>'Юкатан','Yukon Territory'=>'Юкон','Yuma'=>'Юма','Yumbe'=>'Йумбе','Yunnan / 云南'=>'Юньнань','Zacapa'=>'Сакапа','Zacatecas'=>'Сакатекас','Zaire'=>'Заир','Zala'=>'Зала','Zambales'=>'Самбалес','Zambezi'=>'Замбези','Zambia'=>'Замбия','Zambian kwacha'=>'Замбийская квача','Zamboanga del Norte'=>'Северная Замбоанга','Zamboanga del Sur'=>'Южная Замбоанга','Zamboanga Sibugay'=>'Замбоанга-Сибугей','Zambézia'=>'Замбезия','Zamfara'=>'Замфара','Zamora'=>'Самора','Zamora-Chinchipe'=>'Замора-Чинчипе','Zanjan (زنجان)'=>'Зенджан (زنجان)','Zanzibar North'=>'Занзибар Северный','Zanzibar South'=>'Занзибар Южный','Zanzibar West'=>'Занзибар Западный','Zaragoza'=>'Сарагоса','Zero rate'=>'Нулевая ставка','Zhejiang / 浙江'=>'Чжэцзян','Zimbabwe'=>'Зимбабве','ZIP Code'=>'Индекс','Zip or Postcode of the address being shipped to.'=>'Почтовый индекс, соответствующий адресу доставки.','Zombo'=>'Зомбо','Zone'=>'Зона','Zone does not exist!'=>'Зоны не существует!','Zone ID.'=>'ID Зоны.','Zone name'=>'Название зоны','Zone regions'=>'Регионы зоны','Zonguldak'=>'Зонгулдак','Zoom in/out'=>'Масштаб +/-','Zou'=>'Зу','Zug'=>'Цуг','Zulia'=>'Сулия','Zürich'=>'Цюрих','Ávila'=>'Авила','Åland Islands'=>'Аландские острова','Çanakkale'=>'Чанаккале','Çankırı'=>'Чанкыры','Çorum'=>'Чорум','Ñeembucú'=>'Ньеэмбуку','Ñuble'=>'Ньюбле','İstanbul'=>'Стамбул','İzmir'=>'Измир','İçel'=>'Ичель','Şanlıurfa'=>'Шанлыурфа','Şırnak'=>'Ширнак','Șoldănești'=>'Шолданешты','Ștefan Vodă'=>'Штефан-Водэ','— No Change —'=>'— Без изменений —','— No change —'=>'— Без изменений —','“New Account” emails are sent when a customer signs up via the checkout flow.'=>'Эл. письма "Новая учётная запись" отправляются, когда клиент регистрируется во время оформления заказа.','⚠ There\'s one order pending sync from the orders table to the posts table. The feature shouldn\'t be disabled until this order is synchronized.'=>'⚠ Обнаружен один ожидающий синхронизации заказ из таблицы заказов в таблицу записей. Данная функция не должна быть отключена до тех пор, пока этот заказ не будет синхронизирован.' . "\0" . '⚠ Обнаружено %1$d ожидающих синхронизации заказа из таблицы заказов в таблицу записей. Данная функция не должна быть отключена до тех пор, пока этот заказ не будет синхронизирован.' . "\0" . '⚠ Обнаружено %1$d ожидающих синхронизации заказов из таблицы заказов в таблицу записей. Данная функция не должна быть отключена до тех пор, пока этот заказ не будет синхронизирован.','⚠ There\'s one order pending sync from the posts table to the orders table. The feature shouldn\'t be disabled until this order is synchronized.'=>'⚠ Обнаружен один ожидающий синхронизации заказ из таблицы записей в таблицу заказов. Данная функция не должна быть отключена до тех пор, пока этот заказ не будет синхронизирован.' . "\0" . '⚠ Обнаружено %%1$d ожидающих синхронизации заказа из таблицы записей в таблицу заказов. Данная функция не должна быть отключена до тех пор, пока этот заказ не будет синхронизирован.' . "\0" . '⚠ Обнаружено %%1$d ожидающих синхронизации заказов из таблицы записей в таблицу заказов. Данная функция не должна быть отключена до тех пор, пока этот заказ не будет синхронизирован.','⚠ This feature shouldn\'t be enabled, the %s plugin is active and isn\'t compatible with it.'=>'⚠ Эту функцию не следует включать, плагин %s активен и несовместим с ним.','⚠ This feature shouldn\'t be enabled: %1$s, %2$s and %3$d more active plugin isn\'t compatible with it'=>'⚠ Не активируйте эту функцию: с ней несовместимы %1$s, %2$s и ещё %3$d активных плагина (-ов)' . "\0" . '⚠ Не активируйте эту функцию: с ней несовместимы активные плагины %1$s и %2$s. Есть другие несовместимые плагины (%3$d).' . "\0" . '⚠ Не активируйте эту функцию: с ней несовместимы активные плагины %1$s и %2$s. Есть другие несовместимые плагины (%3$d).','⚠ This feature shouldn\'t be enabled: the %1$s and %2$s plugins are active and aren\'t compatible with it.'=>'⚠ Эту функцию не следует включать: плагины %1$s и %2$s активны и несовместимы с ней.','⚠ This plugin is incompatible with the enabled WooCommerce feature \'%s\', it shouldn\'t be activated.'=>'⚠ Этот плагин несовместим с включенной функцией WooCommerce «%s», его не следует активировать.','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\' and \'%2$s\', it shouldn\'t be activated.'=>'⚠ Плагин не следует активировать из-за несовместимости с используемыми функциями WooCommerce: %1$s и %2$s.','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\', \'%2$s\' and %3$d more, it shouldn\'t be activated.'=>'⚠ Плагин не следует активировать из-за несовместимости с используемыми функциями WooCommerce: %1$s, %2$s и ещё %3$d.']];
